function processSale() {
    console.log('Procesando venta...');
    calculateTotal();
    generateReceipt();
}

function calculateTotal() {
    var pricePerTicket = 5; // Precio por entrada
    var count = document.getElementById('ticketCount').value;
    var total = pricePerTicket * count;
    document.getElementById('totalCost').value = total.toFixed(2);  // Guarda solo el número
    document.getElementById('totalCostDisplay').textContent = 'S./' + total.toFixed(2);  // Muestra el valor con formato al usuario
}


function cancelReceipt() {
    var receiptElement = document.getElementById('receipt');
    receiptElement.style.display = 'none';
}

function generateReceipt() {
    const count = document.getElementById('ticketCount').value;
    const total = 5 * count;  // Precio por entrada
    const formattedDate = new Date().toLocaleDateString('es-ES', { year: 'numeric', month: '2-digit', day: '2-digit' });
    const sede = sessionStorage.getItem('sede') || 'default';
    const date = new Date().toISOString().slice(0, 10);  // Formato YYYY-MM-DD

    fetch(`/api/nextSaleCode?sede=${sede}&date=${date}`)
        .then(response => response.json())
        .then(data => {
            if (data.nextCode) {
                console.log("Código obtenido del servidor:", data.nextCode);  // Deberías ver este log en la consola

                document.getElementById('date').textContent = 'Fecha: ' + formattedDate;
                document.getElementById('quantity').textContent = 'Cantidad de Entradas: ' + count;
                document.getElementById('total').textContent = 'Costo Total: S./' + total.toFixed(2);
                document.getElementById('code').textContent = 'Código Único: ' + data.nextCode;

                const receiptElement = document.getElementById('receipt');
                receiptElement.style.display = 'block';
                receiptElement.scrollIntoView({ behavior: 'smooth', block: 'start' });
            } else {
                console.error('No se recibió un código válido:', data.message);
                alert('No se pudo obtener un código válido para la previsualización del recibo: ' + data.message);
            }
        })
        .catch(error => {
            console.error('Error al obtener el próximo código:', error);
            alert('Error al generar la previsualización del recibo: ' + error.message);
        });
}


function confirmSale() {
    var date = new Date().toISOString().slice(0, 10); // Fecha en formato YYYY-MM-DD
    var quantity = document.getElementById('ticketCount').value;
    var total = document.getElementById('totalCost').value.replace(/[^\d.-]/g, '');
    var sede = sessionStorage.getItem('sede'); // Recuperando la sede almacenada en sessionStorage
    var code = sessionStorage.getItem('currentSaleCode'); // Usar el código pre-generado

    fetch('/api/registerSale', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({ date, quantity, total, code, sede }) // Incluyendo el código en el cuerpo de la solicitud
    })
    .then(response => response.json())
    .then(data => {
        if (data.message === 'Venta registrada con éxito') {
            alert('Venta registrada con éxito! Código generado: ' + data.code);
            document.getElementById('code').textContent = 'Código Único: ' + data.code;
            printReceipt(); // Llamar a printReceipt para generar el PDF
        } else {
            alert('Error al registrar la venta: ' + data.message);
        }
    })
    .catch(error => {
        console.error('Error:', error);
        alert('Error al registrar la venta: ' + error.message);
    });
}



function printReceipt() {
    const jsPDF = window.jspdf.jsPDF;
    const doc = new jsPDF({
        orientation: 'p',
        unit: 'mm',
        format: [58, 100]  // Dimensiones ajustadas para la impresora de 58 mm
    });

    // Intentar obtener el elemento y su contenido
    const codeElement = document.getElementById('code');
    let codigo = '';

    if (codeElement && codeElement.textContent) {
        const parts = codeElement.textContent.split(':');
        if (parts.length > 1) {
            codigo = parts[1].trim();
            console.log("Código a imprimir:", codigo);
        } else {
            console.error('El formato del texto del código no es válido:', codeElement.textContent);
        }
    } else {
        console.error('Elemento del código no encontrado o vacío.');
    }

    // Cargar la imagen
    const imgData = "data:image/png;base64,"; // Tu imagen en base64
    // Añadir la imagen al PDF (x, y, anchura, altura)
    doc.addImage(imgData, 'PNG', 21, 5, 15, 15);  // Ajusta las dimensiones como necesites

    // Generar el contenido del PDF
    doc.setFontSize(10);
    doc.text('ENTRADA INTERCLUBES', 29, 25, null, null, 'center');
    doc.setFontSize(8);
    doc.text(`Fecha: ${new Date().toLocaleDateString('es-ES')}`, 5, 35);
    doc.text(`Cantidad de Entradas: ${document.getElementById('ticketCount').value}`, 5, 45);
    doc.text(`Costo Total: ${document.getElementById('totalCost').value}`, 5, 55);

    // Verificamos que 'codigo' no esté vacío antes de imprimir
    if (codigo) {
        doc.text(`Código: ${codigo}`, 5, 65);
    } else {
        doc.text('Código no disponible', 5, 65);
        console.error('Código no disponible para imprimir.');
    }

    // Guardar el PDF
    doc.save('receipt.pdf');
}


function generateDailyReport() {
    const today = new Date().toISOString().slice(0, 10); // Formato YYYY-MM-DD
    fetch('/api/generateDailyReport?date=' + today)
    .then(response => {
        if (!response.ok) {
            throw new Error('Error al generar el reporte diario: ' + response.statusText);
        }
        return response.json();
    })
    .then(data => {
        if (data.success) {
            printDailyReport(data.report);
        } else {
            alert('Error al generar el reporte diario');
        }
    })
    .catch(error => {
        console.error('Error:', error);
        alert('Error de conexión al generar el reporte');
    });
}

function printDailyReport(report) {
    var receiptWindow = window.open('', '_blank', 'width=200,height=600');

    if (!receiptWindow) {
        alert("La ventana emergente fue bloqueada. Por favor, permita las ventanas emergentes para esta aplicación.");
        return;
    }

    var content = `
        <!DOCTYPE html>
        <html lang="es">
        <head>
            <meta charset="UTF-8">
            <meta name="viewport" content="width=device-width, initial-scale=1.0">
            <title>Reporte Diario</title>
            <style>
                body {
                    width: 7.5cm;
                    font-family: 'Arial', sans-serif;
                    font-size: 12px;
                    line-height: 1.5;
                    text-align: center;
                    padding: 5mm;
                }
            </style>
        </head>
        <body>
            <h2>Reporte Diario</h2>
            <p><strong>Fecha:</strong> ${report.date}</p>
            ${report.sections.map(section => `
                <h3>Sede: ${section.sede}</h3>
                <p>Total Entradas: ${section.total_tickets}</p>
                <p>Ingresos Totales: S/.${section.total_income.toFixed(2)}</p>
            `).join('')}
        </body>
        </html>
    `;

    receiptWindow.document.write(content);
    receiptWindow.document.close(); // Finish writing to the new window
    receiptWindow.focus(); // Focus on the new window to bring it to the front
    receiptWindow.print(); // Open the print dialog
    receiptWindow.onfocus = function() {
        setTimeout(function() {
            receiptWindow.close();
        }, 1000);
    };
}


function logout() {
    fetch('/api/logout', {
        method: 'POST'
    })
    .then(response => {
        if (response.ok) {
            window.location.href = '/login'; // Redirige al usuario a la página de inicio de sesión
        } else {
            alert('Error al cerrar sesión');
        }
    })
    .catch(error => {
        console.error('Error:', error);
        alert('Error de conexión al intentar cerrar sesión');
    });
}





